import React from 'react'

const Footer = () => {
  return (
    <div
      style={{
        position: 'absolute',
        bottom: '0',
        width: '100%',
        height: '60px' /* Height of the footer */,
        background: '#6cf',
      }}>
      Footer
    </div>
  )
}

export default Footer
